// import $ from "jquery";
import './App.css';

function Main() {
  return (
    <React.Fragment>
      <h1>main</h1>
    </React.Fragment>
  )
}

function Redirect() {
  const urlParams = new URL(window.location.href).searchParams;
  const name = urlParams.get('code');
